    <article>
      <h2 class="heading-orange" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="150">
        The Machine<br />
        Learning Process
      </h2>

      <p data-aos="fade-up" data-aos-duration="1500" data-aos-delay="150">
        Machine learning (ML) is a subset of artificial intelligence (AI) that can be described as any AI model that can learn and improve from experience to imitate intelligent human behaviour without being explicitly programmed.
      </p>

      <img
        class="mb-s-reverse"
        src="/badge-assets/fake-news/svg/illustration--deep-learning.svg"
        width="584"
        height="338"
        loading="lazy"
