        data-aos-duration="1500"
        data-aos-delay="150"
      />

      <div class="side-by-side">
        <div class="side-by-side__text">
          <h4 class="inherit" data-aos="fade-up" data-aos-duration="1500">In machine learning applications, a data scientist or analyst:</h4>

          <ul class="list list--one-col">
            <li class="list__item list__item--grey" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="450">
              1. Collects relevant datasets and prepares them for analysis
            </li>

            <li class="list__item list__item--grey" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="450">
              2. Chooses the suitable machine learning model to use
            </li>

            <li class="list__item list__item--grey" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="450">
              3. Trains the model using the prepared dataset to find patterns and make predictions
            </li>

            <li class="list__item list__item--grey" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="450">
              4. Evaluates the model to see if its accuracy can be improved
            </li>

            <li class="list__item list__item--grey" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="450">
              5. Runs the model to make predictions for its intended purpose
            </li>
          </ul>
