    <article>
      <h2 class="heading-orange" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="150">
        The<br />
        Deep Learning<br />
        Process
      </h2>

      <p data-aos="fade-up" data-aos-duration="1500" data-aos-delay="150">
        Deep learning is a branch of machine learning that is inspired by the way a human brain processes information. This type of model uses a <span class="tooltipster jsTooltip" data-tooltip-content="#tooltip13_content">neural network</span> to train and improve itself to perform tasks by processing huge amounts of data within seconds. Neural networks have multiple layers which progressively extract higher-level features from the raw input.
      </p>

      <img
        class="mb-s-reverse"
        src="/badge-assets/fake-news/svg/illustration--machine-learning.svg"
        width="632"
        height="518"
        loading="lazy"
        alt="Machine learning illustration"
        data-aos="fade-up"
        data-aos-duration="1500"
        data-aos-delay="150"
      />

      <div class="side-by-side">
        <div class="side-by-side__text">
          <h4 class="inherit" data-aos="fade-up" data-aos-duration="1500">In deep learning applications, a data scientist or analyst:</h4>

          <ul class="list list--one-col">
            <li class="list__item list__item--grey" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="450">
              1. Collects relevant datasets and prepares them for analysis
            </li>

            <li class="list__item list__item--grey" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="450">
              2. Chooses the suitable deep learning model to use
            </li>

            <li class="list__item list__item--grey" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="450">
              3. Trains the model using large amounts of labelled data
            </li>

            <li class="list__item list__item--grey" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="450">
              4. Tests and evaluates the modelâ€™s performance against unlabelled data
            </li>

            <li class="list__item list__item--grey" data-aos="fade-up" data-aos-duration="1500" data-aos-delay="450">
              5. Runs the model to make predictions for its intended purpose
            </li>
